import React from 'react'
import Base from '../components/Base'
import MyCartCheckOutForm from '../components/MyCartCheckOutForm';

const MyCartCheckout=()=> {
  return (
    <div>
        <Base/>
        <MyCartCheckOutForm/>
        </div>
  )
}

export default MyCartCheckout;
